('a0676b41-bfdd-47b0-a894-ebb089f34cad', 'Riju', 'Koley', 'koleyriju41@gmail.com', '9635987603', NULL, 'Churchill Brothers Elite Residential Academy', 'images/coachingCentres/logo/691f5506ea00d_1763661062.jpg', NULL, 1.00, 'enquiry time - 9:45 a.m -6:45pm\r\ndays operational sat and sun \r\nChurchill Brothers Elite Residential Academy is a premier youth development program dedicated to nurturing the next generation of football talent through world-class training, holistic education, and disciplined residential care. Built on the legacy of Churchill Brothers FC, one of India’s most respected football clubs, the academy blends professional coaching with strong academic support to create a balanced, high-performance environment for young athletes.\r\n\r\nWith modern infrastructure, UEFA- and AFC-licensed coaches, and a curriculum designed to develop technical excellence, tactical intelligence, physical fitness, and sportsmanship, the academy ensures that every player receives top-tier training. Beyond the pitch, students benefit from structured academic programs, nutrition planning, mental conditioning, and character-building initiatives.', '1,16,17,20,40,49,70,76,117', 'male', 0, 0, '9635987609', '9:45 AM', '6:45 PM', 'koleyriju41@gmail.com', 'ROFAIR RESIDENCY, opp. Prakash Garage, Calvaddo, Navelim, Goa, India', 'ROFAIR RESIDENCY, opp. Prakash Garage, Calvaddo, Navelim, Goa, India', '403707', 45248, 1600, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-20 23:10:15', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-20 23:10:15', '2025-11-21 14:29:38', NULL, '22.830683905630877', '88.11999611493913', 17),
