('a069aec1-c296-4b76-a92d-aaf08126bf20', 'Kshitij', 'Patil', 'Mumbaiultrasfc@gmail.com', '9819925104', NULL, 'Mumbai Ultras Football Club', 'coaching/photo/6920ce475942f_1763757639.jpg', NULL, 2.00, 'Your child’s journey to football excellence begins here! Mumbai Ultras Football Academy is where skills meet passion. From beginner’s level to advanced mastery, our age-specific training program is designed to build strong fundamentals and life skills. Our licensed & trained coaches are dedicated to nurturing the potential of every player.\r\nWhy Ultras?\r\n*AFC & AIFF Licensed Coaches\r\n*Age Specific Batches\r\n*Pathway from youth to senior team\r\n*For Boys & Girls (Age: 5 to 15)', '40,47,55,13', 'male,female', 0, 0, '9819925104', '9:00 AM', '9:00 PM', 'Mumbaiultrasfc@gmail.com', '6VW3+C7M, I C Colony, Marian Colony', 'Borivali', '400103', 46820, 1611, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-22 02:10:39', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-22 02:10:39', '2025-11-22 14:36:16', NULL, '19.2460783', '72.8531833', 10),
