('a06b1d0d-72bf-47e6-8fb2-d2be27f499ac', 'ujjwal', 'ghosh', 'ujjwalghosh046@gmail.com', '8348329002', NULL, 'Mushapur Netaji Sports Club Academy', 'coaching/photo/6921be558843c_1763819093.jpg', NULL, 10.00, 'Enquiry time - 10:00am to 6:00pm\r\ndays operational Wednesday Friday Saturday and Sunday\r\nMushapur Netaji Sports Club Football Academy is a dedicated grassroots football training centre committed to nurturing young talent and promoting the spirit of the sport in the region. With a mission to develop disciplined, skilled, and confident players, the academy provides structured coaching under experienced trainers who focus on technical excellence, tactical understanding, physical fitness, and sportsmanship.\r\n\r\nThe academy offers age-group training programs, regular practice sessions, and participation opportunities in local and district-level tournaments, ensuring that every player gains exposure and competitive experience. Beyond football skills, Mushapur Netaji Sports Club Football Academy aims to build character, teamwork, and leadership qualities in every athlete.', '1,16,17,20,22,40,76', 'male', 0, 0, '8348329002', '10:15 AM', '6:30 PM', 'ujjwalghosh046@gmail.com', 'R45H+QJV, Abhirampur, West Bengal 713144, India', 'R45H+QJV, Abhirampur, West Bengal, India', '712405', 48789, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-22 19:14:53', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-22 19:14:53', '2025-11-23 23:58:28', NULL, '23.8094875', '88.12904689999999', 17),
('a06b5d8c-8fcd-4a0a-be5c-1298eb91fc61', 'Indrajit', 'Sarkar', 'soumikghosh98@gmail.com', '9874575722', NULL, 'Barisha Netaji Sangha Badminton Academy', 'coaching/photo/6921e89a3d897_1763829914.jpg', NULL, 8.00, 'Welcome to our Badminton Academy, where passion meets precision! We provide comprehensive training programs designed for all skill levels, from beginners to advanced players. Our experienced coaches focus on technique, strategy, and fitness, ensuring each athlete reaches their full potential. Join our vibrant community and elevate your game as you develop skills, sportsmanship, and a love for badminton. Ready to smash your goals? Let’s get started.', '22,46,15,18,69,40,17,65', 'male,female', 0, 0, '9874575722', '10:00 AM', '8:00 PM', 'soumikghosh98@gmail.com', '1/1A Sukanta Sarani( James Long Sarani, 63, and, 4, Nabalia Para Rd, Behala Chowrasta, Behala, Kolkata, West Bengal 700008, India', 'Behala Chowrasta, Behala, Kolkata, West Bengal 700008, India', '700008', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-22 22:15:14', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-22 22:15:14', '2025-11-23 23:56:56', NULL, '22.486017', '88.3152027', 18),
('a06b98be-baba-46ac-b0fa-3c55bcbbf5f6', 'Debnarayan', 'Bhattacharjee', NULL, '8981983226', NULL, 'Barisha Netaji Sangha Table Tennis Academy', 'coaching/photo/69220f65b1b5c_1763839845.jpg', NULL, 8.00, 'Inquiry timings- 10:00AM-9:00PM\r\nDays Operational- Monday, Tuesday & Friday\r\n\r\n\r\nThe Table Tennis Academy is a premier training center dedicated to cultivating champions of all ages and skill levels. With expert coaching, state-of-the-art facilities, and a focus on both technique and strategy, we empower players to enhance their performance, foster teamwork, and ignite their passion for the sport. Join us to elevate your game and experience the thrill of table tennis.', '22,15,18,69,76,17,88', 'male,female', 0, 0, '8981983226', '10:00 AM', '9:00 PM', NULL, '16/a/b, Raja Rammohan Roy Rd, Barisha, Kolkata, West Bengal 700008, India', 'Barisha, Kolkata, West Bengal 700008, India', '700008', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-23 01:00:45', 'approved', NULL, NULL, 1, 'a06b5d8c-8fcd-4a0a-be5c-1298eb91fc61', '0', NULL, '2025-11-23 01:00:45', '2025-11-23 23:55:44', NULL, '22.4860275', '88.31520739999999', 18),
('a06bbbd9-af17-417b-a983-4e12ea881710', 'Aninda', 'Mukherjee', 'anindamajumder047@gmail.com', '8910297550', NULL, 'Russa United Club', 'coaching/photo/6922266763dbe_1763845735.jpg', NULL, 40.00, 'Inquiry Timing- 10:00AM-9:00PM\r\nDays Operational - Saturday& Sunday.\r\nWelcome to Russa United club,\r\nThey provide structured, high-quality coaching that builds technical skill, game intelligence, and physical fitness. But just as importantly, a good academy teaches discipline, teamwork, resilience, and confidence.\r\nMany players also benefit from strong support systems: academic guidance, nutrition advice, and mentoring that help them succeed on and off the pitch.', '1,15,17,18,22,40,69,173', 'male,female', 0, 0, '8910297550', '10:00 AM', '9:00 PM', 'anindamajumder047@gmail.com', 'F8PR+JP2, Mahanayak Uttamkumar Sarani, Ashok Nagar, Tollygunge, Kolkata, West Bengal 700040, India', 'Ashok Nagar, Tollygunge, Kolkata, West Bengal 700040, India', '700040', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-23 02:38:55', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-23 02:38:55', '2025-11-23 23:54:16', NULL, '22.4865063', '88.3417686', 18),
('a06cd3f3-e25e-4bb6-9536-03e1686edab1', 'Nazurul', 'Islam', 'nazrulatailors786@gmail.com', '9434435487', NULL, 'Santipur Moonlight Football Academy', 'coaching/photo/6922ddf8c5083_1763892728.jpg', NULL, 12.00, 'Enquiry time - 10:00am-7:00p.m.\r\nDays Operational mon,tue,wed,thu,fri ,sat,sun\r\nSantipur Moonlight Football Academy is a dedicated grassroots training centre committed to nurturing young football talent with passion, discipline, and modern coaching methods. Founded with the vision of creating a strong football culture in Santipur, the academy provides a structured pathway for aspiring players to develop their skills, fitness, and game intelligence.\r\n\r\nWith certified coaches, regular training sessions, and a focus on both individual and team development, the academy ensures that every player receives the right guidance to grow. From fundamental techniques to advanced match strategies, Santipur Moonlight Football Academy offers an environment where young athletes can shine brightly and chase their dreams.', '17,88,16,20,1,76,22', 'male', 0, 0, '9434435487', '10:30 AM', '7:30 PM', 'nazrulatailors786@gmail.com', 'R49J+H5C, Dakshin Ramchandrapur, West Bengal, India', 'R49J+H5C, Dakshin Ramchandrapur, West Bengal, India', '712403', 48789, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-23 15:42:08', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-23 15:42:08', '2025-11-23 23:52:10', NULL, '22.8189375', '88.1303906', 17),
('a06d1c5e-c123-46fa-af11-5cd9a3ac46b4', 'Anirban', 'Bhattacharyya', 'ab.haripal@gmail.com', '9732504005', NULL, 'Taekwondo Academy Of Haripal', 'coaching/photo/69230d6e635bf_1763904878.jpg', NULL, 30.00, 'Enquiry time- 10am to 7pm\r\nDays Operational Sat, Sun\r\nTaekwondo Academy of Haripal is a dedicated martial arts training centre committed to promoting discipline, fitness, and self-defence skills among students of all ages. Established with the vision of empowering young athletes and nurturing future champions, the academy focuses on providing structured Taekwondo training under experienced and certified instructors.\r\n\r\nWith a strong emphasis on physical conditioning, mental strength, and character development, the academy offers programmers designed for beginners, intermediate learners, and competitive athletes. Regular training sessions, belt-grading examinations, and participation in district, state, and national-level tournaments help students grow confidently in the sport.', '17,22,70,20,16,1,117,83', 'male,female', 0, 0, '9732504005', '10:30 AM', '7:30 PM', 'ab.haripal@gmail.com', 'R4H7+989,  Balarampur Haripal, West Bengal, India', 'R4H7+989,  Balarampur Haripal, West Bengal, India', '712403', 48789, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-23 19:04:38', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-23 19:04:38', '2025-11-23 23:50:47', NULL, '22.8284125', '88.1133594', 17),
('a071a4ee-e469-4c90-9362-d870ed77f0e5', 'Saikat', 'Mukherjee', 'Dilipsingh17081983@gmail.com', '8240699818', NULL, 'Russa United Club', 'coaching/photo/692606048ddaf_1764099588.jpg', NULL, 40.00, 'Inquiry timinigs- 10:00AM-9:00PM\r\nDays Operational- Saturday & Sunday\r\nWelcome to our Cricket Academy, where talent meets expertise! We offer top-notch coaching for players of all ages and skill levels, focusing on technique, teamwork, and mental resilience. Our experienced trainers provide tailored training programs that enhance batting, bowling, and fielding skills. Join us to cultivate your cricketing passion, build lasting friendships, and elevate your game to new heights. Let’s hit your targets together on and off the field.', '1,16,17,22,39,40,46,50,70', 'male', 0, 0, '8240699818', '10:00 AM', '9:00 PM', 'Dilipsingh17081983@gmail.com', 'F8PR+JP2, Mahanayak Uttamkumar Sarani, Ashok Nagar, Tollygunge, Kolkata, West Bengal 700040, India', 'Tollygunge, Kolkata, West Bengal 700040, India', '700040', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-26 01:09:48', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-26 01:09:48', '2025-11-26 16:35:53', NULL, '22.4865063', '88.3417686', 18),
('a0728c7f-612e-4b45-9b0c-d31f53a101f2', 'Mahadev', 'Debnath', 'Srigurujoy1990@gmail.com', '7278212188', NULL, 'BharatGuru Sports Yoga Association', 'coaching/photo/69269dc696065_1764138438.jpg', NULL, 3.00, 'Inquiry timings- 8:00AM- 9:00PM\r\nOperational Days- Tuesday, Thursday and Friday.\r\n\r\nRooted in the ancient wisdom of yoga and aligned with modern wellness practices, our academy is dedicated to nurturing holistic growth, balance, and inner transformation. We believe yoga is for everyone—there is no age barrier, no experience required, only the willingness to grow.\r\nAt our academy, every student receives personal attention through thoughtfully guided sessions, tailored modifications, and mindful teaching methods. Our certified instructors create a warm, encouraging environment where physical strength, mental clarity, and emotional well-being flourish together.\r\n\r\nFrom traditional asanas and pranayama to meditation, relaxation techniques, and lifestyle practices, our curriculum is designed to cultivate harmony in mind, body, and spirit. Whether you seek better health, stress relief, spiritual alignment, or a deeper connection with yourself, we are here to support your unique journey.\r\n\r\nJoin us and experience yoga as a pathway to holistic development, healing, and lifelong wellness.', '4,18,22,40,46,65,69,174', 'male,female', 0, 0, '7003707896', '8:00 AM', '9:00 AM', 'Srigurujoy1990@gmail.com', '192, Motilal Gupta Rd, Sodepur Kalitala, Sukanta Pally, Paschim Putiary, Kolkata, West Bengal 700082, India', 'aschim Putiary, Kolkata, West Bengal 700082, India', '700082', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-26 11:57:18', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-26 11:57:18', '2025-11-28 16:04:05', NULL, '22.4844474', '88.33052599999999', 18),
('a074ae57-7b1f-4b76-a864-a14d4fca2508', 'Abhra', 'Goswami', 'gorindojokolkata@gmail.com', '9147025777', NULL, 'Gorin Dojo MMA & Fitness - MMA Training Centre in Kolkata', 'coaching/photo/692803800f780_1764230016.jpg', NULL, 6.00, 'Enquiry time:- 10 A.M to 6 P.M\r\nDays Operational:- Mon to Sat\r\n\r\nGorin Dojo MMA & Fitness was established in November 2019, with a mission to build Kolkata’s first home-grown MMA culture and train world-class fighters from West Bengal. It goes beyond physical training — emphasizing values like discipline, respect, confidence, perseverance and character-building. Alongside self-defence and combat skills, the academy also builds a sense of community, mental focus, and self-improvement that often transcends the training hall.', '4,16,17,18,20,22,40,76,84,85', 'male,female', 0, 0, '9147025777', '10:00 AM', '6:00 PM', 'gorindojokolkata@gmail.com', 'BD Block, Sector 1, Bidhannagar, Kolkata, West Bengal 700064, India', 'Kolkata, West Bengal 700064, India', '700064', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-11-27 13:23:36', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-11-27 13:23:36', '2025-11-27 13:27:02', NULL, '22.5948864', '88.40827259999999', 1),
