('a07fa6dd-c9d8-498f-9c34-f2172363d7c7', 'Asim', 'Pal', 'ashimpaul7862@gmail.com', '9123081718', NULL, 'Prochesta Play Group', 'images/coachingCentres/logo/69405e220387b_1765826082.jpg', NULL, 19.00, 'Inquiry timings-10:00AM- 9:00PM\r\nOperational Days- Saturday\r\n\r\nProchesta Play Group is a dedicated disability sports academy committed to empowering individuals of all abilities through the transformative power of sports. Founded with the vision of creating an inclusive and encouraging environment, Prochesta provides adaptive training programs, accessible facilities, and specialized coaching designed to help athletes build strength, confidence, and community.\r\n\r\nAt Prochesta, we believe that every person—regardless of physical or cognitive challenges—deserves the opportunity to discover their potential. Our academy promotes physical fitness, teamwork, and personal growth while fostering a sense of belonging and joy. From beginner-level participants to aspiring competitive athletes, we support every journey with compassion, professionalism, and respect.\r\n\r\nWith a focus on inclusivity, innovation, and empowerment, Prochesta Play Group continues to break barriers and inspire new possibilities in the world of adaptive sports.', '16,18,40,46,69,147,174,175', 'male,female', 1, 1, '9123081718', '10:00 AM', '9:00 PM', 'ashimpaul7862@gmail.com', 'G85X+R7W, Lake Range, Kalighat, Kolkata, West Bengal 700026, India', 'Kalighat, Kolkata, West Bengal 700026, India', '700026', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-12-03 00:16:48', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-12-03 00:16:48', '2025-12-16 02:07:51', NULL, '22.5096099', '88.34819069999999', 18),
