('a083121e-ee32-4e88-800b-3c965d2f5842', 'subhomay', 'chakraborty', 'subho.subhomay@gmai.com', '7980380712', NULL, 'Shakti Sangha Cricket Academy', 'images/coachingCentres/logo/69318b4b91f54_1764854603.jpg', NULL, 6.00, 'Enquiry Time -10;00am - 7:00pm\r\nDays Operational Tue,wed,Thu,fri,sat,sun\r\nBelur Sakti Sangha Cricket Academy is a dedicated grassroots cricket training center committed to nurturing young talent and shaping the next generation of skilled cricketers. Located in a vibrant sporting community, the academy focuses on providing structured coaching, modern training methods, and strong values both on and off the field.\r\n\r\nWith experienced coaches, disciplined practice sessions, and facilities designed to develop technical, tactical, and physical skills, the academy helps players grow with confidence and passion. Belur Sakti Sangha Cricket Academy regularly participates in tournaments, inter-club matches, and talent development programs, ensuring holistic exposure and competitive learning for every trainee.', '1,16,17,20,22,40,76', 'male,female', 0, 0, '7980380712', '10:00 AM', '7:00 PM', 'subho.subhomay@gmai.com', 'J8PX+WFM, Dharmatala Rd, Belur, Bally, Howrah, West Bengal 711201, India', 'J8PX+WFM, Dharmatala Rd, Belur, Bally, Howrah, West Bengal 711201, India', '711201', 48790, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-12-04 17:04:11', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2025-12-04 17:04:11', '2025-12-05 12:57:32', NULL, '22.6373476', '88.3486605', 17),
('a08773b3-264a-4dab-a63c-6857da91a9cb', 'Sudip', 'Chatterjee', 'barishaathleticclub@gmail.com', '8282881952', NULL, 'Barisha Athletic Club', 'coaching/photo/693450bd62861_1765036221.jpg', NULL, 75.00, 'Inquiry Timings- 10:00AM-9:00PM\r\nOperational days- Weekdays in the Evening &Weekends in the Morning \r\nFounded in 1952, Barisha Athletic Club has grown into a respected institution in Kolkata, dedicated to nurturing youth potential through sport, mentorship, and community leadership. Guided by the vision of “helping our younger generation reach their full potential,” the club fosters an inclusive and vibrant sporting culture where values of efficiency, transparency, trust, and respect are lived every day.\r\nFrom organizing landmark events like the All Bengal Invitation Basketball Tournament to building bridges between generations, the club stands as a beacon of resilience, character, and opportunity. Many of our players proudly represent the state and universities at the national level, and through their achievements gain opportunities for employment in leading corporates and government organizations.\r\nMore than a sports organization, Barisha Athletic Club is a movement—empowering young minds to rise, thrive, and lead, while honoring the legacy of its members and shaping a stronger, values-driven future for the community.', '15,16,22,40,46,47,69,70,174,175', 'male', 0, 0, '8282881952', '10:00 AM', '9:00 PM', 'barishaathleticclub@gmail.com', '129, Vidyasagar, Purba Barisha, Kolkata, West Bengal 700008, India', 'Purba Barisha, Kolkata, West Bengal 700008, India', '700008', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-12-06 21:20:21', 'approved', NULL, NULL, 1, 'a082f04f-39ab-4180-aa50-fb4afba26ad4', '0', NULL, '2025-12-06 21:20:21', '2025-12-07 00:09:07', NULL, '22.4752488', '88.31313899999999', 18),
