('a099f484-30dd-4d66-a3fd-c1d95c8b5fad', 'Asim', 'Pal', NULL, NULL, NULL, 'Prochesta Play Group', 'coaching/photo/6940710f595d8_1765830927.jpg', NULL, 19.00, 'Inquiry timings-10:00AM- 9:00PM\r\n Operational Days- Tuesday\r\n Prochesta Play Group is a dedicated disability sports academy committed to empowering individuals of all abilities through the transformative power of sports. Founded with the vision of creating an inclusive and encouraging environment, Prochesta provides adaptive training programs, accessible facilities, and specialized coaching designed to help athletes build strength, confidence, and community. At Prochesta, we believe that every person—regardless of physical or cognitive challenges—deserves the opportunity to discover their potential. Our academy promotes physical fitness, teamwork, and personal growth while fostering a sense of belonging and joy. From beginner-level participants to aspiring competitive athletes, we support every journey with compassion, professionalism, and respect. With a focus on inclusivity, innovation, and empowerment, Prochesta Play Group continues to break barriers and inspire new possibilities in the world of adaptive sports.', '22,69,175,174,88,180,17,18', 'male,female', 1, 1, NULL, '9:00 AM', '10:00 PM', NULL, 'Blue Sky Field, Banshtala, Harinavi, Rajpur Sonarpur, Kolkata, West Bengal 700149, India', 'Rajpur Sonarpur, Kolkata, West Bengal 700149, India', '700049', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2025-12-16 02:05:27', 'approved', NULL, NULL, 1, 'a07fa6dd-c9d8-498f-9c34-f2172363d7c7', '0', NULL, '2025-12-16 02:05:27', '2025-12-16 12:27:35', NULL, '22.4263896', '88.4157821', 18),
