('a0d79716-abc2-406b-ac9f-8b48e58ebea4', 'Madhusudan', 'Sir', NULL, NULL, NULL, 'Akhada Basketball Academy', 'coaching/photo/6968d5b479a6b_1768478132.jpg', NULL, 8.00, 'Enquiry Time:- 10 A.M to 7 P.M\r\nDays Operational:- Sun to Sat\r\n\r\nAkhada Basketball Academy is dedicated to developing disciplined, skilled, and resilient basketball players through professional coaching and structured training. We focus on building strong fundamentals, physical fitness, and a winning mindset both on and off the court.', '40,17,4,22,15,20,18,46,76', 'male,female', 0, 0, NULL, '10:00 AM', '7:00 PM', NULL, 'Basavanapura Rd, TC Palya, Battarahalli, Bengaluru, Karnataka, India', 'Battarahalli, Bengaluru,', '560049', 45870, 1606, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2026-01-15 17:25:32', 'approved', NULL, NULL, 1, 'a0c97cf0-0921-4f98-b5eb-dea767da4c1c', '0', NULL, '2026-01-15 17:25:32', '2026-01-15 17:25:32', NULL, '13.0194302', '77.7085586', 1),
('a0d7d2aa-d9e8-4f4b-9896-2219255e09b3', 'Anirban', 'Bhattacharyya', NULL, NULL, NULL, 'Haripal Yoga Academy', 'coaching/photo/6968fcc029670_1768488128.jpg', NULL, 30.00, 'Enquiry Time - 10:00 - 7:00pm\r\nDays Operational - Thu,Sat\r\nHaripal Yoga Academy is a dedicated wellness center committed to promoting physical health, mental peace, and holistic well-being through the ancient science of yoga. The academy offers structured yoga training for all age groups, focusing on asanas, pranayama, meditation, and mindfulness practices.\r\n\r\nWith experienced instructors and a calm, supportive environment, Haripal Yoga Academy aims to help individuals improve flexibility, strength, concentration, and overall lifestyle balance. The academy also emphasizes stress management, fitness, and inner harmony, encouraging a healthy and disciplined way of life.', '17,40,22,20,4,13,84', 'male,female', 1, 0, NULL, '10:00 AM', '7:00 PM', NULL, 'Haripal, West Bengal, India', 'Haripal Station Rd, Haripal, Gopinagar, West Bengal 712405, India', '712405', 48789, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2026-01-15 20:12:08', 'approved', NULL, NULL, 1, 'a06d1c5e-c123-46fa-af11-5cd9a3ac46b4', '0', NULL, '2026-01-15 20:12:08', '2026-01-16 11:14:16', NULL, '22.8172172', '88.1047287', 17),
('a0d8dd43-2958-4579-b528-8ae93a78d0e9', 'Kamal', 'Bhanu', 'km965453@gmail.com', '9654537112', NULL, 'Kamal sports academy', 'coaching/photo/6969ab77569b4_1768532855.jpg', NULL, 7.00, 'Skating is a fun and exciting sport. In skating, a person moves smoothly on a surface using skates with wheels or blades. It helps improve balance, fitness, and coordination. Skating can be done for fun, exercise, or competitions. It also makes the body strong and keeps the mind fresh.', '46,76,65,69,49,15,17,40', 'male', 0, 0, '9654537112', '10:00 AM', '9:15 PM', 'km965453@gmail.com', 'near Jhulelal Society, Shiva Enclave', 'Pitampura, Delhi, 110034, India', '110034', 45214, 1599, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2026-01-16 08:37:35', 'approved', NULL, NULL, 1, NULL, '1', NULL, '2026-01-16 08:37:35', '2026-01-16 11:13:55', NULL, '28.69579329999999', '77.1355142', 20),
('a0da1617-8bdd-4986-8056-04f668bc5dcf', 'Subrata', 'Majumder', 'subartamajumder737@gmail.com', '9038338894', NULL, 'Moitree Sansad Cricket Academy', 'coaching/photo/696a787b721c9_1768585339.jpg', NULL, 4.00, 'Inquiry Time: 6pm to 9 pm\r\nDays Operational: Saturday & Sunday\r\n\r\nWelcome to our Cricket Academy, where talent meets expertise! We offer top-notch coaching for players of all ages and skill levels, focusing on technique, teamwork, and mental resilience. Our experienced trainers provide tailored training programs that enhance batting, bowling, and fielding skills. Join us to cultivate your cricketing passion, build lasting friendships, and elevate your game to new heights. Let’s hit your targets together on and off the field.', '22,15,46,29,70,40,17,18,69', 'male', 0, 0, '9038338894', '6:00 PM', '9:00 PM', 'subartamajumder737@gmail.com', 'Badal Pally, Aurobindo Park, Kolkata, West Bengal 700070, India', 'Bansdroni, Kolkata, West Bengal 700070, India', '700070', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2026-01-16 23:12:19', 'pending_approval', NULL, NULL, 1, NULL, '1', NULL, '2026-01-16 23:12:19', '2026-01-16 23:12:19', NULL, '22.4742536', '88.3550777', 18),
('a0da3619-6266-4ac0-b871-08f4e277e3f9', 'Amit', 'Balmiki', 'amitkumarbalmiki07@gmail.com', '9830593887', NULL, 'Seishinkai Shito-Ryu Karate Do Federation', 'images/coachingCentres/logo/696a912bc5dde_1768591659.jpg', NULL, 8.00, 'Inquiry Time: 10 am to 9pm \r\nDays Operatyional- Wednesday & Saturday\r\n\r\n\r\nWelcome to Seishinkai Shito-Ryu Karate Do Federation, where passion meets performance. Our state-of-the-art facility offers top-tier sports training and recreational activities for all ages. With cutting-edge equipment, expert coaches, and a vibrant community, we inspire excellence. Whether you\'re honing skills, staying fit, or unwinding, Howrah Shotokan Karate - Do Academy is your ultimate destination.', '1,17,18,22,40,70,76,175', 'male,female', 0, 0, '9830593887', '10:00 AM', '9:00 PM', 'amitkumarbalmiki07@gmail.com', '192, Motilal Gupta Rd, Sodepur Kalitala, Sukanta Pally, Paschim Putiary, Kolkata, West Bengal 700082, India', ', Paschim Putiary, Kolkata, West Bengal 700082, India', '700082', 48825, 1626, NULL, 'SISE TECHNOLOGY PVT LTD', 'Axis Bank', '923020039684280', 'UTIB0000775', NULL, 1, '2026-01-17 00:41:49', 'pending_approval', NULL, NULL, 1, NULL, '1', NULL, '2026-01-17 00:41:49', '2026-01-17 00:57:39', NULL, '22.4844474', '88.33052599999999', 18);
