('0559af75-ff57-4d87-9fb9-de72a8fe73b8', 'a07d0b93-f8db-48ca-b7c5-1480d0735f92', '9b99b897-d6a0-4856-a2cf-4437d6fbbfdd', 'Our lawn tennis academy offers professional coaching, quality courts, and structured training to help players improve skills, fitness, and confidence.', 1, '2025-12-01 17:10:56', '2025-12-01 17:10:56'),
('066d5d8d-cf17-4969-b272-42189e5b0fca', 'a093088a-dadc-47b3-a903-9c2e1c948db4', '9b99ba2b-6de2-452e-b3dc-570b9fce4865', 'Our Taekwondo Academy provides disciplined, high-quality training focused on self-defense, fitness, and character development. Led by certified instructors, we offer safe and structured sessions for all ages and skill levels. Build strength, confidence, and respect—one kick at a time.', 1, '2025-12-12 15:30:42', '2025-12-12 15:30:42'),
('0c0a4dd6-167d-45a2-adf5-eaf809c9542a', 'a01c812e-bcc1-41d2-8047-5d3228a52854', '4bb4402b-b309-4bf5-93d4-15176aeed317', '\'Play A Sport\'\r\n\'Play A Sport\' is an initiative to amalgamate Sports with Technology and create an online platform to build more room for the sports community. \'Play A Sport\' will be an application through which a user will be able to access a sport of his/her choice and be able to play/learn the same.', 1, '2025-10-14 17:24:28', '2025-10-14 17:24:28'),
('10bc4276-7673-49b6-8a83-811b407739d9', '9f9b981e-bbf4-4f9b-af83-f7b175ba9bb0', '745c653e-2706-4cce-8197-5ffee68c6b35', '\"From batting power to bowling precision — we turn players into champions.\"', 1, '2025-08-11 15:26:49', '2025-08-11 15:26:49'),
('12f5215a-dee6-403b-be19-e6438f67e4d1', 'a014772d-d82e-4c67-976a-dbdda8d5a9f1', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Inquiry Timing: 11 Am to 9 Pm\r\nDays Operational: Mon to Sat\r\n\r\nAt our Academy, we blend fitness and self-defense to create an empowering experience for all skill levels. With dynamic classes led by experienced trainers, you’ll learn powerful techniques while improving your strength, coordination, and confidence. Join us to kickstart your fitness journey, develop discipline, and unleash your potential in a supportive and motivating environment.', 1, '2025-10-10 17:29:52', '2025-10-10 17:29:52'),
('1613c3f5-d9e4-4dd3-a620-e512709a99d4', 'a096ca32-8c8b-4a9f-83b3-f21589487f8b', '9b99b897-d6a0-4856-a2cf-4437d6fbbfdd', 'GreenCourt Lawn Tennis Academy offers expert lawn tennis coaching for beginners to advanced players. Our certified coaches focus on developing strong fundamentals, fitness, and match skills through structured and personalized training programs. With well-maintained courts and a positive learning environment, we help players build confidence, improve performance, and enjoy the game. Suitable for all age groups.', 1, '2025-12-14 12:19:38', '2025-12-14 12:19:38'),
('1695f6ae-c89a-4368-b595-d6537533945b', 'a005f74c-3f5a-41ea-b511-6ef06f83837a', '9c5cd82f-3452-4a3b-b379-e531f39d6f65', 'VYK Runners also offers gymnastics training that builds flexibility, balance, coordination, and strength, helping individuals develop a strong and disciplined foundation in fitness.', 1, '2025-10-03 12:30:43', '2025-10-03 12:30:43'),
('16994f68-75d8-4de5-a59d-589d4fe5acfa', '9ff81670-8740-44a0-8472-f6ba7b0a5ae1', '9f3abc9a-2399-4d2a-81f0-2b4fa541f30f', 'NIS Coach Vinayak Shirke trains athletes in powerful javelin techniques, teaching body coordination, grip, and release. His coaching has produced medal-winning throwers at state and national levels.', 1, '2025-09-26 14:56:11', '2025-09-26 14:56:11'),
('177bdb3f-8833-4d12-b62f-195dd4a448b8', '9fc802fd-20e4-4020-a013-70845a25bb74', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Sports India Karate Academy provides expert coaching in traditional karate, focusing on discipline, self-defense, and overall fitness. The academy helps students build confidence, strength, and character through structured training.', 1, '2025-09-02 17:22:04', '2025-09-02 17:22:04'),
('1e62fe2a-0d75-449d-8f03-6e787a58f42d', 'a080ef4e-0589-46c2-a4e8-6283b102752f', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Karate is a traditional Japanese martial art that focuses on self-defense, discipline, and personal development. It combines powerful strikes—such as punches, kicks, knee strikes, and elbow blows—with defensive blocks, stances, and swift movements. Practitioners, called karatekas, train to develop strength, speed, balance, and mental focus.', 1, '2025-12-03 15:35:11', '2025-12-03 15:35:11'),
('20194379-5f9c-4d39-a2e8-feea3d83f90e', '9f9b981e-bbf4-4f9b-af83-f7b175ba9bb0', '4bb4402b-b309-4bf5-93d4-15176aeed317', 'Sharpen your reflexes and dominate the table with expert-guided sessions.\"', 1, '2025-08-11 15:26:49', '2025-08-11 15:26:49'),
