('328def8e-4a89-45d7-8410-74bc07e8c4c3', 'a06894bf-2e45-4daf-996b-7eb653ce9e43', '06da21af-f11c-4cd9-8ecc-b21d3de9ad2c', 'dssfsfs', 1, '2025-11-21 13:02:06', '2025-11-21 13:02:06'),
('36af4dc8-239c-4d8f-85e6-cd730af5c9df', 'a01c812e-bcc1-41d2-8047-5d3228a52854', '745c653e-2706-4cce-8197-5ffee68c6b35', '\'Play A Sport\'\r\n\'Play A Sport\' is an initiative to amalgamate Sports with Technology and create an online platform to build more room for the sports community. \'Play A Sport\' will be an application through which a user will be able to access a sport of his/her choice and be able to play/learn the same.', 1, '2025-10-14 17:24:28', '2025-10-14 17:24:28'),
('36ffa2dc-2c91-4ef8-97d4-61754ca15ac0', 'a0911992-e10b-49eb-a193-0eac99fde00d', '9b99ba2b-6de2-452e-b3dc-570b9fce4865', 'Our Taekwondo Academy provides disciplined, high-quality training focused on self-defense, fitness, and character development. Led by certified instructors, we offer safe and structured sessions for all ages and skill levels. Build strength, confidence, and respect—one kick at a time.', 1, '2025-12-11 16:26:37', '2025-12-11 16:26:37'),
('46c65d9e-d710-490b-9ccb-e9bd94dce77f', 'a004de16-d684-4d7a-a671-ebe8e9823c4a', '9c5cda8c-a97c-4e84-8caa-9cf3a93cafb1', 'VYK Runners also offers physical fitness training designed to improve overall strength, flexibility, and health. With expert guidance, we help individuals stay fit, active, and strong in daily life.', 1, '2025-10-02 23:24:24', '2025-10-02 23:24:24'),
('556a1b1f-e099-47c7-906f-8aff598bbb08', 'a0911992-e10b-49eb-a193-0eac99fde00d', '9bd60cd9-2dda-4a5d-ac6d-217a26baaa1a', 'Our Yoga Academy offers a peaceful space to learn authentic yoga, improve flexibility, reduce stress, and build inner balance. Guided by experienced instructors, we provide simple, effective practices suitable for all levels. Begin your journey toward a healthier, calmer you.', 1, '2025-12-11 16:26:37', '2025-12-11 16:26:37'),
('58bd85ec-04ab-461e-97b8-9035964bb039', 'a07d0b93-f8db-48ca-b7c5-1480d0735f92', 'ca54244e-a967-4c6c-9cce-1a9ddb44cb25', 'Our football academy offers professional coaching, structured training, and a supportive environment to develop skills, fitness, and teamwork.', 1, '2025-12-01 17:10:56', '2025-12-01 17:10:56'),
('5a363e31-e6cf-4e39-87bf-7c7937eaddbb', 'a068989f-755c-447c-8b6a-3c4efddacd93', '9ff24cb9-fffd-4e06-8b77-0a68341c5b10', 'Operational Days: Monday to Saturday\r\nEnquiry Time: 10:00 AM to 9:00 PM\r\n\r\nThe athletics program focuses on enhancing strength, speed, agility, and overall endurance. With personalized training and modern facilities, athletes are guided to achieve peak performance. The academy fosters dedication, resilience, and a passion for sports in every participant.', 1, '2025-11-21 13:12:56', '2025-11-21 14:55:01'),
('6bec5bfa-9ddc-4519-b37b-ba2cf9d3c10b', 'a09316be-a522-4601-b5b3-14f4431e61c6', 'ca54244e-a967-4c6c-9cce-1a9ddb44cb25', 'PrimeKick Football Academy provides professional football training for players of all ages and skill levels. Our experienced coaches focus on building strong fundamentals, improving fitness, and developing tactical awareness through structured drills and game-based sessions. With high-quality facilities and a motivating environment, we help young athletes grow their skills, boost confidence, and play the game with passion. Perfect for beginners to advanced players aiming to reach their full potential.', 1, '2025-12-12 16:10:24', '2025-12-12 16:10:24'),
('6eb3fe9f-fd9b-4335-87a9-81b4f41be563', '9fc128d6-ee03-474e-88af-bbac25fb50e9', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Sports India Karate Academy (Dahisar) offers expert karate training for children aged 4 years and above. Guided by Master Hitesh Mandhare, the academy builds discipline, fitness, and self-defense skills through structured weekend sessions.', 1, '2025-08-30 07:37:06', '2025-08-30 07:37:06'),
('6f9e88e9-637c-40d2-b26e-e8d0a6f19a6a', 'a09316be-a522-4601-b5b3-14f4431e61c6', '9b99b897-d6a0-4856-a2cf-4437d6fbbfdd', 'AcePoint Lawn Tennis Academy offers professional tennis coaching for all ages and skill levels. Our certified coaches provide personalized training programs focused on technique, fitness, and match strategy. With well-maintained courts, modern equipment, and a supportive learning environment, we help players build confidence, improve performance, and enjoy the game. Whether you\'re a beginner or aspiring competitor, AcePoint is your destination for world-class tennis training.', 1, '2025-12-12 16:10:24', '2025-12-12 16:10:24'),
('73b4da6b-6e79-4191-b115-7b1b21f1d939', '9f9b981e-bbf4-4f9b-af83-f7b175ba9bb0', '06da21af-f11c-4cd9-8ecc-b21d3de9ad2c', 'Master the art of speed, skill, and teamwork with our elite hockey training program.', 1, '2025-08-11 15:26:49', '2025-08-11 17:32:11'),
('74b00f67-3fa6-4341-b634-2b8c2d37de40', 'a014805f-17a6-402d-886a-307c7ddb0b01', '9be7fdb3-29f1-41d4-abbc-9c53e9eb1de0', 'Our academy Empowering students through disciplined training in martial arts. We focus on self-defense, fitness, and character development for all ages and skill levels in a safe, respectful, and motivating environment.', 1, '2025-10-10 17:55:35', '2025-10-10 17:55:35'),
