('7917468d-e77f-43e6-a88b-0ecf25af134a', 'a09316be-a522-4601-b5b3-14f4431e61c6', '9c5cd640-8468-48ef-9032-7e48c94985b3', 'GlidePro Skating Academy offers expert training in roller and inline skating for beginners to advanced learners. Our certified instructors focus on balance, technique, safety, and confidence-building through structured lessons and fun practice sessions. With a supportive environment and modern facilities, we help skaters improve their skills, stay active, and enjoy the thrill of skating. Perfect for kids, teens, and adults looking to learn or level up their skating abilities.', 1, '2025-12-12 16:10:24', '2025-12-12 16:10:24'),
