('c8f8998b-2d82-4c48-ac0d-620564af9714', '9ff81670-8740-44a0-8472-f6ba7b0a5ae1', '9ff24cb9-fffd-4e06-8b77-0a68341c5b10', 'At Aim Sports Academy, NIS Coach Vinayak Shirke provides expert training in sprinting, middle-distance, and long-distance running. Athletes build stamina, speed, and technique to excel at every level.', 1, '2025-09-26 14:56:11', '2025-09-26 14:56:11'),
('c8fd7fbd-c967-4c61-b9c9-ae2a2f8243f3', 'a068989f-755c-447c-8b6a-3c4efddacd93', 'ca54244e-a967-4c6c-9cce-1a9ddb44cb25', 'Operational Days: Monday to Saturday\r\nEnquiry Time: 10:00 AM to 9:00 PM\r\n\r\nOur academy is dedicated to empowering specially-abled children through personalized coaching, skill development, and supportive learning environments.\r\nWith trained educators, structured programs, and compassionate guidance, we help every child grow with confidence and joy.', 1, '2025-11-21 13:12:56', '2025-11-21 13:12:56'),
('cc6105eb-f888-4518-b883-eb642cc61b7e', '9fb5e832-fe76-487b-9588-e3601f31492e', '9c5cd82f-3452-4a3b-b379-e531f39d6f65', 'Anthang Sports Foundation, located in Kandivali West, offers professional gymnastics coaching for children aged 4 years and above. Under the guidance of Coach Tanmay Asegaonkar, the academy emphasizes flexibility, strength, balance, and discipline, helping young athletes build a strong foundation through structured and safe training sessions', 1, '2025-08-24 17:22:17', '2025-08-24 17:22:17'),
('ce958af3-3f92-4a44-ad7e-ada7602c0882', '9fc1a405-92ac-4d2b-8226-cd75fb302049', '9bd60c8f-eb48-462a-8444-10b131c7d02d', 'Sports India karate Academy provides professional Mixed Martial Arts training for youth and adults. With a focus on strength, endurance, and combat techniques, Coach Omm Padhi helps students improve fitness and self-defense while learning modern martial arts skills.', 1, '2025-08-30 13:21:33', '2025-08-30 13:21:33'),
('cf9cdef5-c68e-41da-ac0d-a6828cc715d1', 'a080ef4e-0589-46c2-a4e8-6283b102752f', 'ca54244e-a967-4c6c-9cce-1a9ddb44cb25', 'Football, commonly known as soccer, is the world’s most popular sport. It is played between two teams of eleven players on a rectangular field with a goal at each end. The main objective is to score goals by moving the ball into the opponent’s net using any part of the body except the hands and arms. Only the goalkeeper is allowed to handle the ball within the penalty area.', 1, '2025-12-03 15:35:11', '2025-12-03 15:35:11'),
('d7116411-c962-4a27-a33f-c8c532bd5725', '9ff81670-8740-44a0-8472-f6ba7b0a5ae1', '9ff24cfb-b348-4246-a609-3844104af121', 'At Aim Sports Academy, NIS Coach Vinayak Shirke provides professional shot put training in stance, glide, and rotational techniques, helping athletes achieve podium finishes at major competitions.', 1, '2025-09-26 14:56:11', '2025-09-26 14:56:11'),
('d99d4ab0-1a6b-409f-b0c9-8cb401e7dbe6', '9fc1a405-92ac-4d2b-8226-cd75fb302049', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Sports India Karate Academy offers expert karate training for children aged 4 years and above. Guided by Coach Omm Padhi, the academy builds discipline, fitness, and self-defense skills through structured weekend sessions.', 1, '2025-08-30 13:21:33', '2025-08-30 13:21:33'),
('dcb7aa32-ec66-4279-915d-71039626f5d0', 'a058d0e9-7e3d-4247-b7bb-f3d9a7a3c467', '9b99b84c-3877-4d02-9f59-fcb1063881ff', 'SmallFootfall Running Academy is a dedicated training center focused on developing young athletes through structured running programs. Our academy emphasizes proper technique, discipline, fitness, and confidence-building. With expert coaches, personalized sessions, and a fun learning environment, we help every runner improve speed, stamina, and overall athletic performance. Whether a beginner or aspiring athlete, SmallFootfall provides the perfect foundation for a strong and successful sports journey.', 1, '2025-11-13 16:57:05', '2025-11-13 16:57:05'),
('dcc0050b-e1f8-40a9-9ee5-ab756d36dc79', 'a004de16-d684-4d7a-a671-ebe8e9823c4a', '9ff24cb9-fffd-4e06-8b77-0a68341c5b10', 'VYK Runners provides professional running coaching focused on building speed, stamina, and endurance. Our training programs help runners of all levels improve performance and achieve their goals.', 1, '2025-10-02 23:24:24', '2025-10-02 23:24:24'),
('dd64af5d-c539-4581-84e2-a292e0bc9bce', '9ff81670-8740-44a0-8472-f6ba7b0a5ae1', '9ff24ce6-f2c4-4d5a-9053-8a4f1581148d', 'With NIS Coach Vinayak Shirke’s expert guidance, athletes master discus throw through proper grip, spin, and release while developing rhythm and strength for maximum distance.', 1, '2025-09-26 14:56:11', '2025-09-26 14:56:11'),
('df03970f-eefb-4e59-b7ff-55d8452a448f', 'a01425e7-7a8f-4ba7-a2fa-5ceb9e49c726', '9bd60cd9-2dda-4a5d-ac6d-217a26baaa1a', 'Inquiry Timing: 8 Am to 10 Pm\r\nDays Operational: Mon to Sun\r\n\r\nVoltage Academy — a premier kids gymnastic center in Newtown, Kolkata, and a dedicated yoga studio. Certified trainers provide gentle yoga for beginners and structured yoga training in Kolkata to rebuild strength safely. Join our Newtown studio, the best yoga classes in Newtown for lasting vitality. At Voltage Academy, fitness meets mindfulness, a unique space where children thrive in gymnastics while adults find strength and balance through yoga.', 1, '2025-10-10 13:42:37', '2025-10-10 13:42:37'),
('e38f2ea9-5626-4622-90e1-75e4f95f317f', 'a080ef4e-0589-46c2-a4e8-6283b102752f', '9b99b82e-3d23-4543-ab8f-4262d5319603', 'Basketball is a fast-paced team sport played between two teams of five players each on a rectangular court. The main objective is to score points by shooting a ball through the opponent’s hoop, a raised net and rim positioned 10 feet above the ground. Players move the ball by dribbling (bouncing it while running) or passing it to teammates.', 1, '2025-12-03 15:35:11', '2025-12-03 15:35:11'),
('e963fdb2-6e28-4e69-8553-915434ef5d33', 'a014805f-17a6-402d-886a-307c7ddb0b01', '9b99b90b-ccdc-4970-821f-49c2ccb95e7a', 'Our academy is a place where discipline, confidence, and self-defense come together. We offer expert-led karate training for all ages and skill levels, focusing on technique, fitness, and personal growth in a respectful and supportive environment.', 1, '2025-10-10 17:55:35', '2025-10-10 17:55:35'),
('f4959b75-b1d2-4b44-abee-cb2337d809e0', '9ff81670-8740-44a0-8472-f6ba7b0a5ae1', '9ff24cd0-589e-431c-8783-b6d33e47b4c8', 'Under the guidance of NIS Coach Vinayak Shirke, the academy develops athletes in long jump, high jump, and triple jump with a focus on explosive strength, agility, and perfect take-off techniques.', 1, '2025-09-26 14:56:11', '2025-09-26 14:56:11');
